import React from 'react';

// Function to format AI content like ChatGPT - clean and readable with enhanced emphasis
const formatAIContent = (content) => {
  if (!content) return '';
  
  // Convert markdown-style formatting to HTML for proper display
  let formatted = content
    // Convert section headers with emojis first (before other processing)
    .replace(/^(üìä|üìù|üß†|üé®|üèóÔ∏è|üìã|üîç|‚ú®|üéØ|üîß|üí°|üé≠|üßπ|üìÑ|üå°Ô∏è|‚öñÔ∏è|üîÑ|üåç|üî≤|üìè|üí¨|üßΩ|üìê) \*\*(.*?)\*\*$/gm, '<h3 class="ai-section-header"><span class="ai-emoji">$1</span> <strong>$2</strong></h3>')
    // Convert subsection headers with emphasis
    .replace(/^\*\*(.*?):\*\*$/gm, '<h4 class="ai-subsection-header"><strong>$1:</strong></h4>')
    // Handle important callouts and warnings
    .replace(/^(‚ö†Ô∏è|üö®|‚ùó|‚ö°|üî•|üí°|üìå|üéØ)\s*\*\*(.*?)\*\*$/gm, '<div class="ai-callout ai-callout-important"><span class="ai-callout-icon">$1</span><strong>$2</strong></div>')
    // Handle recommendations and tips
    .replace(/^(‚úÖ|üí°|üîß|üéØ|üìù|üöÄ)\s*(.+)$/gm, '<div class="ai-recommendation"><span class="ai-rec-icon">$1</span><span class="ai-rec-text">$2</span></div>')
    // Convert **text** to bold with enhanced styling
    .replace(/\*\*(.*?)\*\*/g, '<strong class="ai-emphasis">$1</strong>')
    // Handle code snippets and technical terms
    .replace(/`([^`]+)`/g, '<code class="ai-code">$1</code>')
    // Handle numbered lists with enhanced formatting
    .replace(/^(\d+)\.\s*\*\*(.*?)\*\*(.*)$/gm, '<div class="ai-numbered-item ai-numbered-important"><span class="ai-number">$1.</span><span class="ai-number-text"><strong class="ai-emphasis">$2</strong>$3</span></div>')
    .replace(/^(\d+)\.\s*(.+)$/gm, '<div class="ai-numbered-item"><span class="ai-number">$1.</span><span class="ai-number-text">$2</span></div>')
    // Convert bullet points with enhanced styling
    .replace(/^‚Ä¢ \*\*(.*?)\*\*(.*)$/gm, '<div class="ai-bullet-point ai-bullet-important">‚Ä¢ <strong class="ai-emphasis">$1</strong>$2</div>')
    .replace(/^‚Ä¢ (.*?)$/gm, '<div class="ai-bullet-point">‚Ä¢ $1</div>')
    // Handle key-value pairs and definitions
    .replace(/^([A-Z][A-Za-z\s]+):\s*(.+)$/gm, '<div class="ai-definition"><span class="ai-def-term">$1:</span> <span class="ai-def-value">$2</span></div>')
    // Clean up extra line breaks and normalize spacing
    .replace(/\n{3,}/g, '\n\n')
    // Convert double line breaks to paragraph breaks
    .replace(/\n\n/g, '</p><p class="ai-paragraph">')
    // Convert single line breaks to spaces (except in special elements)
    .replace(/(?<!<\/div>)(?<!<\/h3>)(?<!<\/h4>)\n(?!<)/g, ' ')
    // Clean up spaces around HTML tags
    .replace(/\s+</g, '<')
    .replace(/>\s+/g, '>');
  
  // Wrap in paragraph tags if not already wrapped
  if (!formatted.startsWith('<')) {
    formatted = '<p class="ai-paragraph">' + formatted + '</p>';
  }
  
  // Clean up any issues with special elements inside paragraphs
  formatted = formatted
    .replace(/<p class="ai-paragraph">(.*?)<div class="ai-numbered-item">/g, '$1<div class="ai-numbered-item">')
    .replace(/<p class="ai-paragraph">(.*?)<div class="ai-callout">/g, '$1<div class="ai-callout">')
    .replace(/<p class="ai-paragraph">(.*?)<div class="ai-recommendation">/g, '$1<div class="ai-recommendation">')
    .replace(/<p class="ai-paragraph">(.*?)<div class="ai-definition">/g, '$1<div class="ai-definition">')
    .replace(/<\/div>(.*?)<\/p>/g, '</div>$1')
    .replace(/<p class="ai-paragraph"><\/p>/g, '')
    .replace(/<\/p><p class="ai-paragraph">/g, '</p><p class="ai-paragraph">')
    // Ensure special elements are properly separated from paragraphs
    .replace(/(<\/p>)(<div class="ai-numbered-item">)/g, '$1\n$2')
    .replace(/(<\/p>)(<div class="ai-callout">)/g, '$1\n$2')
    .replace(/(<\/p>)(<div class="ai-recommendation">)/g, '$1\n$2')
    .replace(/(<\/p>)(<div class="ai-definition">)/g, '$1\n$2')
    .replace(/(<\/div>)(<p class="ai-paragraph">)/g, '$1\n$2');
  
  return formatted;
};

const AIResults = ({ results, onClear, onRemoveCard }) => {
  if (!results || results.length === 0) return null;

  return (
    <div className="ai-results-section">
      <div className="ai-results-header">
        <h2>üß† AI Analysis Results</h2>
        <button className="ai-clear-all btn btn-secondary" onClick={onClear}>
          Clear All
        </button>
      </div>
      <div className="ai-cards-container">
        {results.map((result, index) => (
          <AICard 
            key={index} 
            result={result} 
            index={index}
            onRemove={onRemoveCard}
          />
        ))}
      </div>
    </div>
  );
};

const AICard = ({ result, index, onRemove }) => {
  return (
    <div className="ai-analysis-card">
      <div className="ai-card-header">
        <h3 className="ai-card-title">{result.title}</h3>
        <button 
          className="ai-card-close"
          onClick={() => onRemove && onRemove(index)}
          title="Remove this analysis"
        >
          √ó
        </button>
      </div>
      <div className="ai-card-content">
        <div className="ai-content-wrapper" dangerouslySetInnerHTML={{ __html: formatAIContent(result.content) }} />
      </div>
    </div>
  );
};

export default AIResults;
